@2023MARA @stckb  I think it comes down to reported earnings. Next potential catalyst is the upcoming Q2 ER, including what new CE0 Sharon says on the earnings call. 

FYI, there are some recent Reddit comments suggesting very high PT patient volumes. I am obviously hoping that’s true for $ATIP. Mgmt seems to have addressed their headcount/attrition problem, and that (in theory) implies that patient volumes should improve as the new hires become more seasoned in their jobs 

Who TF knows? I am looking forward to the ER because it’s been an information vacuum in between ERs

@a2zmicrocap  There’s a substantial and growing mass of medical research describing the efficacy of MicroPulse in treating Glaucoma. 

$IRIX seems to offer a very compelling value proposition to eye Dr’s and their patients—a repeatable outpatient procedure that reduces the need for expensive drugs and invasive surgeries. 

It also makes sense that CMS covers MicroPulse treatments Bullish

@Jollyrogerix   As part of the Topcon JV, $IRIX bought Topcon’s Pascal retina business. So, $IRIX added both Pascal’s revenue and and operating costs.  

$IRIX has also, by design, increased spending on sales and marketing. For example, coincident with the integration of Topcon, $IRIX mgmt split their salesforce into two discrete entities— Glaucoma and Retina—that reflect the  substantial differences in both end markets. Glaucoma salesforce is focused on increasing G6 system utilization rates which means they’re focused high margin (and single use) G6 probe sales (recurring revenue). $IRIX  Retina/Pascal salesforce is focused on selling retina laser systems which are more of a capital equipment sale. 

The difference in the two sales groups can be explained by contact with eyeballs during the relevant procedures. e.g. Glaucoma MicroPulse treatments require G6 Probe contact with the eye (e.g. single use probes = recurring rev.) Retina/Pascal sales are more a 1X capital equipment sale. Bullish

@adjag009 @AllBallBearings There is certainly restructuring risk, but likely not a concern for at least 12 months. I also view this risk as low because the debt maturity in 2023 is one tranche of a senior secured term loan A, which should be fairly easy to refinance in the bank loan market. 

I think the chances of them taking the company private again in a predatory fashion are remote because of their substantial litigation exposure. Fixing the company would probably reduce their exposure to that litigation by a large amount. 

You might remember that the stock traded up sharply after the Q3 earnings call, and then reversed lower on $ATIP’s Q3 10Q disclosure that they had received a voluntary request for information from the SEC. Seems likely that Advent/Fortress/ATI mgmt are focused on fixing the company, not taking it private.

@oddbob  I hear you, and agree that the unexpected disclosure of the spike in attrition, and increasing labor costs is a huge red flag.

This mgmt team deserves to be thrown under the bus for the BS they pulled yesterday, esp. because it makes intuitive sense that they have known about this issue for months. If they were in fact surprised, then we should probably question whether or not they should be running any public company. 

Nevertheless, using equity proceeds to pay down excessive debt is ipso facto a positive for any highly levered company’s longer term prospects, especially for a way over-levered company like $ATI. It’s corporate finance 101.

@Snakeythrower974  That they are going to kill it in China via their $BABA partnership.

Q1 numbers include $FTCH’s first month of operation on $BABA’s Tmall, and $FTCH management’s guidance for 2021 does not include any contribution from China. Other luxury brands such as LMVH have already reported very strong growth in China/Asia 

I suspect the Q1 ER will show continued strong growth, and hopefully an encouraging initial read on $BABA/ Tmall JV. $FTCH stock price is down largely due to the lingering effects of the Archegos margin call/blow up, and the cockroach shorts leaning on anything they feel they can push lower. Bullish
